    <style>
      html, body {
        margin: 0;
        padding: 0;
        height: 100%;
        width: 100%;
      }

      @font-face {
        font-family: Hanakana;
        src: url('https://github.com/mountbuild/tone-script/blob/build/font.otf?raw=true');
      }

      @font-face {
        font-family: Noto;
        src: url('https://github.com/mountbuild/tone-script/blob/build/noto.ttf?raw=true');
      }

      .list {
        display: flex;
        justify-content: center;
        align-items: center;
      }

      #content {
        width: 800px;
        background: #fafafa;
        padding: 20px;
      }

      .row {
        padding: 20px 40px;
      }

      .row * {
        display: block;
      }

      .row:nth-child(2n + 1) {
        background: #fafafa;
      }

      .row:nth-child(2n) {
        background: #fff;
      }

      .hanakana {
        font-size: 90px;
        font-family: Hanakana;
        position: relative;
        top: -6px;
      }

      .ascii {
        font-size: 32px;
        font-family: Noto;
        opacity: 0.4;
        display: block;
        padding-bottom: 10px;
      }

      .encoding {
        font-size: 20px;
        font-family: Noto;
        opacity: 0.4;
        display: block;
      }
    </style>
